(1, 'Asian Global Stocks works by offering different types of plans to invest money. All those people interested in making money will have to do is to just sign up with the website. Then, they can deposit and invest money in the wallet and can invest in the plan that they feel suits them the best.', '<iframe width=\"580\" height=\"430\" src=\"https://www.youtube.com/embed/sEtj34VMClU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', , 'Our clients using the BIA earn compound interest in crypto, significantly increasing their Bitcoin, Ether, Litecoin, PAX Gold, USD Coin (USDC), Gemini Dollar (GUSD), and Tether (USDT)** balances over time. Opening an account is quick and easy. Learn more about how you can start earning interest or refer your friends by exploring our Resource Center.', 'We believe our combination of trading technology and brokerage services gives every client an edge over the competition. But you donât have to take our word for it.', 'Asian Global Stocks allows you to build an investment portfolio consisting of various assets, from cryptocurrencies to stocks and ETFs. The payment can be made in any convenient way, without limitations, and without high entry thresholds.', NULL, '2020-11-21 17:51:28');
